import React from 'react';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import CssBaseline from '@mui/material/CssBaseline';
import Navbar from './components/Navbar';
import Hero from './components/Hero';
import About from './components/About';
import Services from './components/Services';
import InstagramFeed from './components/InstagramFeed';
import Contact from './components/Contact';
import WhatsAppButton from './components/WhatsAppButton';
import IndividualTherapy from './pages/IndividualTherapy';
import YouthTherapy from './pages/YouthTherapy';
import ChildTherapy from './pages/ChildTherapy';
import './App.css';

const theme = createTheme({
  palette: {
    primary: {
      main: '#566542',
    },
    secondary: {
      main: '#2E7D32',
    },
    background: {
      default: '#ffffff',
    },
  },
  typography: {
    fontFamily: '"Roboto", "Helvetica", "Arial", sans-serif',
    h1: {
      fontWeight: 700,
    },
    h2: {
      fontWeight: 600,
    },
    h3: {
      fontWeight: 600,
    },
  },
});

function Home() {
  return (
    <>
      <Navbar />
      <main>
        <Hero />
        <About />
        <Services />
        {/* <InstagramFeed /> */}
        <Contact />
      </main>
      <WhatsAppButton />
    </>
  );
}

function App() {
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <Router>
        <div className="App">
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/individual-therapy" element={<IndividualTherapy />} />
            <Route path="/youth-therapy" element={<YouthTherapy />} />
            <Route path="/child-therapy" element={<ChildTherapy />} />
          </Routes>
        </div>
      </Router>
    </ThemeProvider>
  );
}

export default App;
